import React from 'react';
import styled from 'styled-components';

import { NavLink } from 'react-router-dom';
import {Div} from '../styles/DefaultStyles';



const DivPlayer = styled(Div)`


  color: ${props => props.theme.color_strong};

  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;

  margin: 5px;


`;


const DivBattletag = styled(Div)`
  display: block;

	width: 100%;
	height: 1.4em;

	text-algin: left;
	overflow: hidden;

	white-space: nowrap;
	text-overflow: ellipsis;
`


const DivMmrs = styled(Div)`

  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;

  margin: 2px;

`

const DivMmr = styled(Div)`

  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;

`


const DivRoles = styled(Div)`

  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;

  margin: 2px;

`

const DivRole = styled(Div)`

  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;

`



const DivAlbumCover= styled(Div)`
  position: relative;

	display: flex;
  flex-direction: column;
  justify-content: center;

	position: relative;

  text-align: center;

  &:hover > img {
    opacity:0.2;
  }
  &:hover > div {
    visibility: visible;
  }
}
`

const ImgAlbumCover = styled.img`
  position: absolute;
  z-index:1;

  width: 100%;
  heigth: 100%;

  border-radius: 4%;

`



function Player ({player}) {
	return (

  <DivPlayer> 
    <DivBattletag> mbcat#1111 </DivBattletag>

    <DivMmrs>

      <DivMmr> 
        <Div> NA </Div> 
        <Div> 2222 </Div> 
      </DivMmr>

      <DivMmr> 
        <Div> EU </Div> 
        <Div> 2222 </Div> 
      </DivMmr>

      <DivMmr> 
        <Div> KR </Div> 
        <Div> 2222 </Div> 
      </DivMmr>

      <DivMmr> 
        <Div> CN </Div> 
        <Div> 2222 </Div> 
      </DivMmr>

    </DivMmrs>


    <DivRoles>

      <Div> Tank: 11 </Div>
      <Div> Bruiser: 3 </Div>
      <Div> Melee: 22 </Div>
      <Div> Ranged: 111 </Div>
      <Div> Healer: 6 </Div>
      <Div> Support: 6 </Div>

    </DivRoles>

  </DivPlayer>



	)
}

export default Player;
